import styled from 'styled-components'


const handleSubmit = e => {
    e.preventDefault();
    alert('form');
}

const Register = () => {
  return (
    <>
        <FormContainer>
            <form onSubmit={e=> handleSubmit(e)}>
                

            </form>
        </FormContainer>
    </>
  )
}


const FormContainer = styled.div`

`;
export default Register
